import React, {useState} from 'react';

interface IProps {
    msg: string;
    time:string;
}
interface IState {
  count:number;
}

let Message:React.FC<IProps> =({msg,time}) =>{
    let[countState, setCountState] =useState<IState>({
        count:10
    });
    return(
        <React.Fragment>
            <h2> Message Components</h2>
              <h2>{msg}</h2>
            <h2>{time}</h2>
            <hr/>
            <p className="h1">{countState.count}</p>
            <button className="btn btn-success btn-sm">INC</button>
        </React.Fragment>
    )
};
export default Message;
